import { useEffect, useState } from "react";

const LeadersTable = ({data}) => {
const [dataInfo,setDataInfo] = useState([]);
const [searchWord,setSearchWord] = useState(null);

useEffect(()=>{
  setDataInfo(data);
},[data]);
  return (
    <div>
      <div style={{width:"80%",display:"flex",justifyContent:"start"}}>
        <input onBlur={(text)=> console.log(text.targ)} value={searchWord ?? searchWord} style={{borderRadius:"10px",border:"1px solid black",boxShadow:"0 0 8px black",width:"20%"}} placeholder="sdsdfsdf" type={"text"} />
        <button>click</button>
      </div>
      <table style={{width : "80%",margin: "50px auto"}}>
          <thead>
              <tr>
                  <td>ציון ממוצע סופי</td>
                  <td>ציון ממוצע למטלה</td>
                  <td>עיר</td>
                  <td>תלמידים</td>
                  <td>כיתה</td>
                  <td>בית ספר</td>
                  <td>מקום</td>
              </tr>
          </thead>
          <tbody>
            {dataInfo.map(row => {
                return (
                    <tr>
                    <td>{row.overallAvgGrade}</td>
                    <td>{row.avgGradePerAssignment}</td>
                    <td>{row.city}</td>
                    <td>{row.howManyStudents}</td>
                    <td>{row.grade}</td>
                    <td>{row.school}</td>
                    <td>{row.place}</td>
                </tr>
                );
            })}
          </tbody>
      </table>
    </div>
  );
};

export default LeadersTable;
